  if (probeVars.size() != (29))
  {
    probeVars.resize(29);
    d_probeVars.resize(29);
    for (int i=0;i<29;i++)
    {
      d_probeVars[i].resize(29);
      for (int j=0;j<29;j++)
        d_probeVars[i][j]=0.0;
    }
    staticContributions.resize(14+0);
    d_staticContributions.resize(14+0);
    for (int i=0;i<14+0;i++)
      d_staticContributions[i].resize(29);
    dynamicContributions.resize(14+0);
    d_dynamicContributions.resize(14+0);
    for (int i=0;i<14+0;i++)
      d_dynamicContributions[i].resize(29);
  }

    noiseContribsPower.resize(18);
    noiseContribsExponent.resize(18);

  // initialize contributions to zero (automatically sets derivatives to zero)
  for (int i=0; i < 14+0 ; ++i)
  {
     staticContributions[i]=0;
     for (int j=0;j<29;j++)
        d_staticContributions[i][j] = 0.0;
     dynamicContributions[i]=0;
     for (int j=0;j<29;j++)
        d_dynamicContributions[i][j] = 0.0;
  }

  // extract solution variables and set as Fad independent variables.
