d_probeVars[admsProbeID_V_g_gm][admsProbeID_V_g_gm] = 1.0;
probeVars[admsProbeID_V_gi_e] = (*solVectorPtr)[li_gi] - (*solVectorPtr)[li_e];
d_probeVars[admsProbeID_V_gi_e][admsProbeID_V_gi_e] = 1.0;
probeVars[admsProbeID_V_gm_e] = (*solVectorPtr)[li_gm] - (*solVectorPtr)[li_e];
